        .text-small {
            font-size: 12px;
            color: #333;
        }

        .header-content {
            display: flex;
            justify-content: space-between;
            align-items: center;
        }

        .header-left,
        .header-right {
            display: flex;
            flex-direction: column;
            gap: 5px;
        }

        .header-title {
            font-size: 1.5rem;
            font-weight: bold;
            text-align: center;
            margin: 0;
        }

        @page {
            margin: 20mm; /*     */
        }

        .page-header, .page-header-space {
            height: 100px;
        }

        .page-footer, .page-footer-space {
            height: 50px;
        }

        .page-header, .page-footer {
            width: 100%;
            text-align: center;
        }

        .page-header {
            position: fixed;
            top: 0;
            width: 100%;
            border-bottom: 1px solid black; /* for demo */
        }

        .page-footer {
            position: fixed;
            bottom: 0;
            width: 100%;
            border-top: 1px solid black; /* for demo */
        }

        .page {
            page-break-after: always;
        }

        .content {
            padding: 20px;
        }

        .contract-section {
            font-size: 12px;
            line-height: 1.8;
            text-align: justify;
            margin-top: 1.5rem;
            word-wrap: break-word;
        }

        .article-title {
            font-weight: bold;
            font-size: 14px;
            display: block;
            margin-bottom: 0.5rem;
        }

        .article-content {
            display: block;
            margin-bottom: 0.5rem;
        }

        @media print {
            thead {display: table-header-group;}
            tfoot {display: table-footer-group;}

            body {margin: 0;}
        }
    </style>
</head>
